import React from "react"
import { version, Tree, Input } from "antd"
const { TreeNode } = Tree

const Dragable = () => {
    return <Tree
    draggable={true}
    onDragStart={({ event, node }) => {
        console.log(event.target, '---------', node)
      if (event.target.tagName === "INPUT") {
        event.stopPropagation();
        event.preventDefault();
      }
    }}
    onDragEnd={() => {
        console.log('++++')
    }}
  >
    <TreeNode
      title={
        <div>
          <Input draggable defaultValue="Can't select this" />
          But you can grab me from here !
        </div>
      }
    />
  </Tree>
}

export default Dragable
